package org.beanfuse.rule.model;import java.util.HashSet;import java.util.Set;import org.beanfuse.model.pojo.LongIdTimeObject;import org.beanfuse.rule.Rule;public class RuleConfig extends LongIdTimeObject {    /** 业务规则 */    private Rule rule;        /** 是否启用 */    private boolean enabled;        /** 规则配置参数 */    private Set params = new HashSet();        public Set getParams() {        return params;    }        public void setParams(Set params) {        this.params = params;    }    public Rule getRule() {        return rule;    }       public void setRule(Rule rule) {        this.rule = rule;    }    public boolean isEnabled() {        return enabled;    }        public void setEnabled(boolean enabled) {        this.enabled = enabled;    }}